import React, { Component } from 'react';
import Cards from './Cards'
class Report extends Component {
  render() {
    return (
        <div className="report">
              <button>Accident</button>
              <button>Hazard</button>
              <button>Traffic</button>
          <div><Cards></Cards></div>
          </div>                                        
    );
  }

}
export default Report
